import React from 'react';
import Navvbar1 from "./Navvbar1";

const Resultat = () => {
  return (
    <>
      <Navvbar1 />
      <div style={{ backgroundColor: '#E1EBF6', minHeight: '100vh' }}>
      <div style={{ backgroundColor: '#FFFFFF', justifyContent: 'center', alignItems: 'center' , padding: '40px', 
            borderRadius: '10px',
            position: 'absolute',
            top: '10%',
            left: '50%' }}>
        </div>
      </div>
    </>
  );
};

export default Resultat;
